import React from 'react'
import {Avatar, Button, Card} from 'antd';

export const UserProfile = () => {
  return (
    <Card
        actions={[
            <div key="twit">짹짹<br/></div>,
            <div key="followings">팔로잉<br/></div>,
            <div key="follower">팔로워<br/></div>
        ]}
    >
        <Card.Meta
            avatar={<Avatar>EK</Avatar>}
            title="Eunkk"
        />
        <Button>로그아웃</Button>
    </Card>
  )
}
